      <div className="container">
      <audio src='/theme.mp3' autoPlay loop />
      <div class="mistlediv">
        <img src="/mistletoe.svg" alt="mistletoe" class="mistletoe" />
      </div>
      <h1>Xmas</h1>
        <Link to="/xmaspiano">
            <img src="/logo.jpg" alt="Logo" width="50%" />>   
        </Link>
        <h1>Piano</h1>
        </div>
      </div>
    </>
  );
}

export default withRouter(Intro);
